import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { useTranslation } from '../context/LanguageContext';
import './navbarStyles.css';

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const { t, switchLanguage, language } = useTranslation();

  return (
    <nav className="navbar_unique_shadow bg-white fixed w-full z-50">
      <div className="navbar_unique_container mx-auto flex justify-between items-center p-4">
        <h1 className="navbar_unique_logo text-xl font-bold text-blue-600">üè•</h1>

        <div className="navbar_unique_hamburger md:hidden" onClick={() => setMenuOpen(!menuOpen)}>
          <div className="navbar_unique_bar"></div>
          <div className="navbar_unique_bar"></div>
          <div className="navbar_unique_bar"></div>
        </div>

        <ul className={`navbar_unique_links md:flex space-x-6 text-sm font-medium ${menuOpen ? 'block' : 'hidden'} md:block`}>
          <li><Link to="/">{t('home')}</Link></li>
          <li><Link to="/services">{t('services')}</Link></li>
          <li><Link to="/doctors">{t('doctors')}</Link></li>
          <li><Link to="/ambulance">{t('ambulance')}</Link></li>
          <li><Link to="/reviews">{t('reviews')}</Link></li>
          <li><Link to="/contact">{t('contact')}</Link></li>
          <li>
            <select
              value={language}
              onChange={(e) => switchLanguage(e.target.value)}
              className="navbar_unique_langDropdown"
            >
              <option value="en">EN</option>
              <option value="hi">HI</option>
              <option value="te">TE</option>
            </select>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
